import { NavLink } from 'react-router-dom';
import classes from "./Dialogs.module.css";
import DialogItem from "./DialogItem"
import DialogMessage from "./DialogMessage";



const Dialogs = (props) => {

    let DialogsData =[
        {id:1, name:"Mike"},
        {id:2, name:"Vlad"},
        {id:3, name:"Petr"},
        {id:4, name:"Nastya"},
        {id:5, name:"Artem"},

    ]


    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                <DialogItem name={DialogsData[0].na} id="1" />
                <DialogItem name="Vlad" id="2" />
                <DialogItem name="Petr" id="3" />
                <DialogItem name="Nastya" id="4" />
                <DialogItem name="Artem" id="5" />
            </div>
            <div className={classes.messanges}>
                <DialogMessage messange="bye"/>
                <DialogMessage messange="bye"/>
                <DialogMessage messange="bye"/>
                <DialogMessage messange="bye"/>
                <DialogMessage messange="bye"/>
            </div>
        </div>
    )
}

export default Dialogs;
